import React from 'react';
import {MDBIcon, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView } from 'mdbreact';
import { BrowserRouter as Router } from 'react-router-dom';
import {
  BrowserRouter,
  Switch,
  Route,
  Link,
  NavLink,
} from "react-router-dom";
import SignIn from './SignIn';

import {
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBNavbarLink,
} from 'mdb-react-ui-kit';
import { MDBDropdown, MDBDropdownToggle, MDBDropdownLink,MDBNavbarItem } from 'mdb-react-ui-kit';
import './myStyle.css'

import { Redirect } from 'react-router-dom/cjs/react-router-dom.min';

import { useState } from 'react';
import { useSelector } from 'react-redux';
import ShowCompanies from './ShowCompanies';
import SignUp from './SignUp';
import CompanyUpdate from './CompanyUpdate';
import MyCustomers from './MyCustomers';
import Home from './Home';
import Classification from './Classification';
import CompanyDelete from './CompanyDelete';
import ChartsPage from './Chart'
import LittleChartsPage from './LittleChart'

 export default function FullPageIntroWithFixedNavbar()
{
  const [state,setState]=useState({ collapse: "false",isWideEnough: "false"});
    let IsCompany = useSelector((store) => {return store.Companies.company }); 
    console.log(IsCompany.codeCompany);

    return (
      <Router>
     <div class="img">
      
        <header>
          
         
            <MDBNavbar color="black" dark expand="md" fixed="top">
              <MDBNavbarBrand href="/">

               <strong>Navbar</strong> 
              </MDBNavbarBrand>
              {!state.isWideEnough && <MDBNavbarToggler onClick={onClick} />}
              <MDBCollapse isOpen={state.collapse} navbar>
                <MDBNavbarNav left>
                  <MDBNavItem active>
                
                  </MDBNavItem>
                  
                  <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <MDBNavbarItem class="nav-item dropdown">
                  <MDBDropdown>
                    <MDBDropdownToggle tag='a' className='nav-link'>
                      פרופיל
                  </MDBDropdownToggle>
                    <MDBDropdownMenu >
                      <MDBDropdownItem>
                        <a class="dropdown-item" >  <Link style={{ color: "black", fontSize: "15px" }} to="/SignIn"> התחברות</Link></a>
                      </MDBDropdownItem>
                      {(IsCompany.codeCompany==undefined)&&
                      <MDBDropdownItem>
                        <a class="dropdown-item" >  <Link style={{ color: "black", fontSize: "15px" }} to="/SignUp"> הרשמה</Link></a>
                      </MDBDropdownItem>
                      }
                      {(IsCompany.codeCompany)&&
                      <MDBDropdownItem>
                        <a class="dropdown-item" >  <Link style={{ color: "black", fontSize: "15px" }}  to="/SignUp"> עדכון</Link></a>
                      </MDBDropdownItem>
}
{(IsCompany.codeCompany)&&
                      <MDBDropdownItem>
                        <a class="dropdown-item" >  <Link style={{ color: "black", fontSize: "15px" }} to="/CompanyDelete"> מחיקה</Link></a>
                      </MDBDropdownItem>
}
                    </MDBDropdownMenu>
                  </MDBDropdown>
                </MDBNavbarItem>
              </ul>
              <MDBNavbarLink><NavLink to="/Home">אודות</NavLink></MDBNavbarLink>

            {(IsCompany.codeCompany)&&
                    <MDBNavItem>
                    <MDBNavbarLink><NavLink to="/MyCustomers">הלקוחות שלי</NavLink></MDBNavbarLink>
                    </MDBNavItem>
}
                    {(IsCompany.codeCompany)&&
                    <MDBNavItem>
                    <MDBNavbarLink><NavLink to="/ChartOfYear">תרשים שנתי</NavLink></MDBNavbarLink>
                    </MDBNavItem>
}
                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>
            
          
             <div class="img" ></div> 
                
        </header> 

        <main>
          <MDBContainer className="">
           <SignIn></SignIn>
          </MDBContainer>
        </main>
      </div>
     
          <Switch>
            {/* <Redirect to='/Home' exact component={Home}></Redirect>  */}
            <Route path='/SignIn' exact component={SignIn}></Route> 
            <Route path='/SignUp' exact component={SignUp}></Route> 
            <Route path='/CompanyUpdate/:companycode' exact component={CompanyUpdate}></Route> 
            <Route path='/MyCustomers' exact component={MyCustomers}></Route>
            <Route path='/Home' exact component={Home}></Route>
            <Route path='/Classification' exact component={Classification}></Route>
            <Route path='/CompanyDelete' exact component={CompanyDelete}></Route>
            <Route path='/ChartOfYear' exact component={ChartsPage}></Route>
            <Route path='/ChartOfDate' exact component={LittleChartsPage}></Route>
          </Switch>     
     
      </Router>
    );
    }
